import React from "react";
import { BrowserRouter, Route, Routes } from 'react-router-dom';
import "./App.css";
import Form from "./components/Form";
import Table from "./components/Table";




function App() {
  return (
    <BrowserRouter>
    <Routes>
      <Route path="/" element={<Table />} />
      <Route
          path="/form"
          element={
            <Form
              initialValues={null}
              onClose={() => {}}
              onSubmit={() => {}}
              onDelete={() => {}}
            />
          }
        />
    </Routes>
  </BrowserRouter>
  );
}

export default App;
